import {
  HomeOutlined,
  AppstoreOutlined,
  UnorderedListOutlined,
  ToolOutlined,
} from '@ant-design/icons';
const menuList = [
    {
      title: '首页', // 菜单标题名称
      key: '/home', // 对应的path
      icon: <HomeOutlined />, // 图标名称
      isPublic: true, // 公开的
    },
    {
      title: '商品',
      key: '/prod_about',
      icon: <AppstoreOutlined />,
      children: [ // 子菜单列表
        {
          title: '分类管理',
          key: '/category',
          icon: <UnorderedListOutlined />
        },
        {
          title: '商品管理',
          key: '/product',
          icon: <ToolOutlined />
        },
      ]
    },
  
    {
      title: '用户管理',
      key: '/user',
      icon: 'user'
    },
    {
      title: '角色管理',
      key: '/role',
      icon: 'safety',
    },
  
    {
      title: '图形图表',
      key: '/charts',
      icon: 'area-chart',
      children: [
        {
          title: '柱形图',
          key: '/charts/bar',
          icon: 'bar-chart'
        },
        {
          title: '折线图',
          key: '/charts/line',
          icon: 'line-chart'
        },
        {
          title: '饼图',
          key: '/charts/pie',
          icon: 'pie-chart'
        },
      ]
    },
  
    {
      title: '订单管理',
      key: '/order',
      icon: 'windows',
    },
  ]
  
  export default menuList
